import React from 'react';

const card = () => {
	return (
		<div className='bg-light-green dib br3 pa3 ma2 grow'>
			<img alt='robot' src='https://media.licdn.com/dms/image/C5103AQHAsBPWl0NLsQ/profile-displayphoto-shrink_200_200/0?e=1553731200&v=beta&t=4bOWQ_ktgTzp1OJPl7rGZawqzZR0UelVL4kHtJWon1E' />
			<div>
				<h2>Richard Widjaya</h2>
				<p>ricwidjaya@gmail.com</p>
			</div>
		</div>
	);
}

export default card;
